import React from 'react'
import ExpenseItem from './Components/ExpenseItem'

const Expenses = (data) => {
  return (
    <div>
           {data.value.map((index,id) => {
        return <ExpenseItem text={data.expenses} title={index.title} amount={index.amount} date={index.date} key={id}></ExpenseItem>
      })}
    </div>
  )
}

export default Expenses
